import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import React, {useState, useEffect, Component} from "react";
import {useNavigate} from 'react-router-dom'
import LoginIcon from '@material-ui/icons/AlternateEmail';
import PasswordIcon from '@material-ui/icons/VpnKey';
import './login.css'

import {Link} from "react-router-dom";
import logo from "./logo.png";

let timer;

const setLogoutTimer = (expirationTime, email) => dispatch => {
    timer = setTimeout(() => {
        dispatch(logoutUser(email));
    }, expirationTime);
};

export const logoutUser = (email) => {
    return async dispatch => {
        return await axios.post('http://ec2-3-35-154-116.ap-northeast-2.compute.amazonaws.com:8080/api/auth/logout', email, {
            headers: { "Content-Type": `application/json` }
        })
            .then(function (res) {
                if (res.status == 200) {
                    axios.defaults.headers.common['X-AUTH-TOKEN'] = undefined
                    AsyncStorage.getItem('kakaoLogin').then((value) => {
                        clearLogoutTimer();
                        AsyncStorage.clear();
                        dispatch({
                            type: LOGOUT_USER,
                            payload: 'end',
                        });

                        if (value) {
                            KakaoLogins.logout().then(result => {
                                console.log(result);

                            })
                        }
                    });
                }
            }).catch(function (err) {
                console.log(err);
                dispatch({
                    type: LOGOUT_USER,
                    payload: 'failure',
                });
            })
    }

};

function Login() {
    const [email, setEmail] = useState("")
    const [password, setPassword] = useState("")

    const nav = useNavigate()
    useEffect(() => {
        if(localStorage.getItem('user-info')) {
            nav("/administrator/front")
        }
    }, [])

    async function log() {
        console.warn(email,password)
        let item = {email,password}
        let result = await fetch("http://ec2-3-35-154-116.ap-northeast-2.compute.amazonaws.com:8080/api/auth/login", {
            method:"POST",
            headers: { "Content-Type": `application/json` },
            body: JSON.stringify(item)
        })
            .then(function (res) {
                if(res.status == 200) {
                    localStorage.getItem('email').then(value => {
                        if(value != null) {
                            log(set)
                        }
                    })
                }
            })
        result = await result.json();
        localStorage.setItem("user-info",JSON.stringify(result))
        console.warn(result)
        nav("/administrator/front")
    }

    return (
        <header className="App-header">
            <img src={logo} className="App-logo" alt="logo"/>
            <div className="inline">
                <span className="red">관리자 </span>
                <span>화면 로그인</span>
            </div>
            <a
                className="App-link"
                href="https://github.com/EastHShin/SWCapstone_Opinio"
                target="_blank"
                rel="noopener noreferrer"
            >
                Source Code
            </a>
            <Container>
                <Form>
                    <div className="center">
                        <LoginIcon color="secondary" fontSize="large"></LoginIcon>
                        <Form.Group className="inline" controlId="form.Email" style={{width: "370px"}}>
                            <Form.Control type="email" placeholder="이메일"
                                          onChange={(e) => setEmail(e.target.value)}/>
                        </Form.Group>
                    </div>
                    <div className="center">
                        <PasswordIcon color="secondary" fontSize="large"></PasswordIcon>
                        <Form.Group className="inline" controlId="form.Password" style={{width: "370px"}}>
                            <Form.Control className="wid" type="password" placeholder="비밀번호"
                                          onChange={(e) => setPassword(e.target.value)}/>
                        </Form.Group>
                    </div>
                    <div>
                        <Link to="/administrator/front">
                            <Button variant="success" onClick={log}>Login</Button>
                        </Link>
                    </div>
                </Form>
            </Container>
        </header>
    );
}

export default Login;
